            <div className="max-h-[70%] flex flex-col items-center">
              <img className="h-full" src={featured1} alt="" />
            </div>
            <h1 className="font-semibold">Slim Fit Dress Shirt</h1>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Homepage;
